import React, { useState } from 'react';
import { Route } from 'react-router-dom';
import Welcome from './components/Welcome';
import Products from './components/Products';


function App() {

  const [showRoute, setShowRoute] = useState(true);
  const routeHandler = () => {
    if(!Route.path){
      setShowRoute(false);
    }
  }
  return (
    <div>
      <Route path="/welcome" >
          <Welcome />
      </Route>
      <Route path="/products" >
          <Products />
      </Route>

    </div>
  );
}

export default App;
